import React from "react";

function StopButtonHandler ({buttonDisable, setButtonDisable}) {
    const handleClick = () => {
        setButtonDisable(false);
    };

    if (buttonDisable === true){
        return (
            <button
            type="button"
            className="btn btn-secondary"
            data-testid="stop"
            title="Stop the session"
            onClick={handleClick}
            >
                <span className="oi oi-media-stop" />
            </button>
        );
    } else {

    }
}

export default StopButtonHandler;
